package urjc.com.wayfindingapp.old;

import android.graphics.Bitmap;
import android.graphics.BitmapFactory;
import android.os.Bundle;
import android.util.Base64;
import android.widget.ImageView;

import androidx.appcompat.app.AppCompatActivity;

import urjc.com.wayfindingapp.R;

//import android.support.v7.app.AppCompatActivity;

public class prueba_plano extends AppCompatActivity {

    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        setContentView(R.layout.activity_prueba_plano);

        ImageView imageView = (ImageView)findViewById(R.id.plano);

        String base64String = "data:plano/jpeg;base64,";

        String base64Image = base64String.split(",")[1];

        byte[] decodedString = Base64.decode(base64Image, Base64.DEFAULT);
        Bitmap decodedByte = BitmapFactory.decodeByteArray(decodedString,
                0, decodedString.length);

        imageView.setImageBitmap(decodedByte);

    }

}